import LogoIcon from "./icons/logo";
import SearchIcon from "./icons/search";
import ProfileIcon from "./icons/profile";
import CartIcon from "./icons/cart";

function App(props) {
  return (
    <>
      <Header />
      <main>{props.child}</main>
      <Footer />
    </>
  );
}

function Header() {
  return (
    <header>
      <div className="header-logo">
        <LogoIcon className="header-logo-icon" />
      </div>
      <div className="header-menu">
        <ul>
          <li>Men</li>
          <li>Woman</li>
          <li>Kids</li>
          <li>Sale</li>
          <li>Featured</li>
        </ul>
      </div>
      <div className="header-search">
        <input name="search" placeholder="Search" />
        <SearchIcon className="header-search-icon" />
      </div>
      <div className="header-etc">
        <ProfileIcon className="header-profile-icon" />
        <CartIcon className="header-cart-icon" />
      </div>
    </header>
  );
}

function Footer() {
  return (
    <footer>
      <div className="footer-menu">
        <ul>
          <li>Shop</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </div>
      <div className="footer-about">
        <LogoIcon className="footer-logo-icon" />
        <p>
          GoCart: Step into your fantasy with our fictional footwear collection.
          Explore our online world of unique styles and adventures!
        </p>
      </div>
    </footer>
  );
}

export default App;
